class ProjectListExpenditureResponseModel {  List<ProjectListExpenditure>? data;  ProjectListExpenditureResponseModel({this.data});  ProjectListExpenditureResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectListExpenditure>[];      json.forEach((v) {        data!.add(new ProjectListExpenditure.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectListExpenditure {  int? expenditureId;  int? manageProjectId;  String? type;  int? objId;  String? objCode;  ExpenditureInfo? expenditureInfo;  ProjectListExpenditure(      {this.expenditureId,        this.manageProjectId,        this.type,        this.objId,        this.objCode,        this.expenditureInfo});  ProjectListExpenditure.fromJson(Map<String, dynamic> json) {    expenditureId = json['expenditure_id'];    manageProjectId = json['manage_project_id'];    type = json['type'];    objId = json['obj_id'];    objCode = json['obj_code'];    expenditureInfo = json['expenditure_info'] != null        ? new ExpenditureInfo.fromJson(json['expenditure_info'])        : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['expenditure_id'] = this.expenditureId;    data['manage_project_id'] = this.manageProjectId;    data['type'] = this.type;    data['obj_id'] = this.objId;    data['obj_code'] = this.objCode;    if (this.expenditureInfo != null) {      data['expenditure_info'] = this.expenditureInfo!.toJson();    }    return data;  }}class ExpenditureInfo {  int? receiptId;  String? receiptCode;  int? staffId;  String? fullName;  int? totalMoney;  String? status;  String? createdAt;  int? paymentId;  String? paymentCode;  ExpenditureInfo(      {this.receiptId,        this.receiptCode,        this.staffId,        this.fullName,        this.totalMoney,        this.status,        this.createdAt,        this.paymentId,        this.paymentCode});  ExpenditureInfo.fromJson(Map<String, dynamic> json) {    receiptId = json['receipt_id'];    receiptCode = json['receipt_code'];    staffId = json['staff_id'];    fullName = json['full_name'];    totalMoney = json['total_money'];    status = json['status'];    createdAt = json['created_at'];    paymentId = json['payment_id'];    paymentCode = json['payment_code'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['receipt_id'] = this.receiptId;    data['receipt_code'] = this.receiptCode;    data['staff_id'] = this.staffId;    data['full_name'] = this.fullName;    data['total_money'] = this.totalMoney;    data['status'] = this.status;    data['created_at'] = this.createdAt;    data['payment_id'] = this.paymentId;    data['payment_code'] = this.paymentCode;    return data;  }}class ExpenditureTypeModel {    String? paymentType;    String? paymentName;    bool isSelected;    ExpenditureTypeModel({this.paymentType, this.paymentName, this.isSelected = false});}class ExpenditureFilter {  ExpenditureTypeModel? type;  String? fromDate;  String? toDate;  ExpenditureFilter({this.type, this.fromDate, this.toDate});}